import React from 'react';

function MyInfo() {
    const firstName='Mostafa'
    const lastName='Hazareh'
    return (
        <div>
            <h1>I AM {`${firstName} ${lastName}`}</h1>
            <h4>My Skills are:</h4>
            <ul>
                <li>HTML</li>
                <li>CSS</li>
                <li>JavaScript</li>
                <li>ReactJS</li>
            </ul>
        </div>
    );
}

export default MyInfo;
